import axios from "axios";
const Home = () => {
    const [posts, setPots] = useState([]);
    useEffect(() => {
        const fetchPosts = async () => {
            const res = await axios.get("/posts")
            try{
                setPots(res.data);
                console.log(posts)
            }catch (err){
                console.log(err);
            }

        }
        fetchPosts();
    },[])
    return (
        <>
            <Header/>
            <div className="home">
                <Posts/>
                <Sidebar/>
            </div>
        </>

    )
}

export default Home;
